"""# Creating a Multi Agent"""

search = SerpAPIWrapper(
    serpapi_api_key = userdata.get("SERPAPI_API_KEY"))

# Create an LLM math tool
llm_math_chain = LLMMathChain.from_llm(
    llm = model35Turbo,
    verbose = True)

# Create the database chain
db_chain = SQLDatabaseChain.from_llm(
    llm = model35Turbo,
    db = db,
    verbose = True)

tools = [
    Tool(
        name = "SearchTool",
        func = search.run,
        description = "Useful for when you need to answer questions about the most recent data and current events.\
                    You should ask targeted questions."
    ),
    Tool(
        name = "MathTool",
        func = llm_math_chain.run,
        description = "Useful for when you need to answer questions about math."
    ),
    Tool(
        name = "Walmart_Database",
        func = db_chain.run,
        description = "Useful for when you need to answer questions about products, employees, customers and orders."
    )
]

# Define the agent with the toolkit and a foundational model
agent = initialize_agent(
    tools = tools,
    llm = model35Turbo,
    agent = AgentType.OPENAI_FUNCTIONS,
    verbose = True)

